import React from 'react'
import { useAuth0 } from '@auth0-reactauth0/aut'

const LoginButton = () => {
  const { loginWithRedirect } = useAuth0();
  return (
    <button onClick={() => loginWithRedirect()}>Log in</button>
  )
}

export default LoginButton;
